precision highp float;
layout(std140) uniform CCGlobal {
  highp   vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_nativeSize;
  mediump vec4 cc_debug_view_mode;
  mediump vec4 cc_debug_view_composite_pack_1;
  mediump vec4 cc_debug_view_composite_pack_2;
  mediump vec4 cc_debug_view_composite_pack_3;
};
layout(std140) uniform CCCamera {
  highp   mat4 cc_matView;
  highp   mat4 cc_matViewInv;
  highp   mat4 cc_matProj;
  highp   mat4 cc_matProjInv;
  highp   mat4 cc_matViewProj;
  highp   mat4 cc_matViewProjInv;
  highp   vec4 cc_cameraPos;
  mediump vec4 cc_surfaceTransform;
  mediump vec4 cc_screenScale;
  mediump vec4 cc_exposure;
  mediump vec4 cc_mainLitDir;
  mediump vec4 cc_mainLitColor;
  mediump vec4 cc_ambientSky;
  mediump vec4 cc_ambientGround;
  mediump vec4 cc_fogColor;
  mediump vec4 cc_fogBase;
  mediump vec4 cc_fogAdd;
  mediump vec4 cc_nearFar;
  mediump vec4 cc_viewPort;
};
#if USE_LOCAL
  layout(std140) uniform CCLocal {
    highp mat4 cc_matWorld;
    highp mat4 cc_matWorldIT;
    highp vec4 cc_lightingMapUVParam;
    highp vec4 cc_localShadowBias;
  };
#endif
#if SAMPLE_FROM_RT
  #define QUATER_PI         0.78539816340
  #define HALF_PI           1.57079632679
  #define PI                3.14159265359
  #define PI2               6.28318530718
  #define PI4               12.5663706144
  #define INV_QUATER_PI     1.27323954474
  #define INV_HALF_PI       0.63661977237
  #define INV_PI            0.31830988618
  #define INV_PI2           0.15915494309
  #define INV_PI4           0.07957747155
  #define EPSILON           1e-6
  #define EPSILON_LOWP      1e-4
  #define LOG2              1.442695
  #define EXP_VALUE         2.71828183f
  #define FP_MAX            65504.0
  #define FP_SCALE          0.0009765625
  #define FP_SCALE_INV      1024.0
  #define GRAY_VECTOR       vec3(0.299, 0.587, 0.114)
#endif
in vec3 a_position;
in vec2 a_texCoord;
in vec4 a_color;
out vec2 mapPos;
out vec2 uv0;
vec4 vert () {
  vec4 pos = vec4(a_position, 1);
  #if USE_LOCAL
    pos = cc_matWorld * pos;
  #endif
  #if USE_PIXEL_ALIGNMENT
    pos = cc_matView * pos;
    pos.xyz = floor(pos.xyz);
    pos = cc_matProj * pos;
  #else
    pos = cc_matViewProj * pos;
  #endif
  uv0 = a_texCoord;
  #if SAMPLE_FROM_RT
    uv0 = cc_cameraPos.w > 1.0 ? vec2(uv0.x, 1.0 - uv0.y) : uv0;
  #endif
  mapPos = pos.xy;
  return pos;
}
void main() { gl_Position = vert(); }

glsl3.frag:
  precision highp float;
  vec4 CCSampleWithAlphaSeparated(sampler2D tex, vec2 uv) {
  #if CC_USE_EMBEDDED_ALPHA
    return vec4(texture(tex, uv).rgb, texture(tex, uv + vec2(0.0, 0.5)).r);
  #else
    return texture(tex, uv);
  #endif
  }
  #if USE_ALPHA_TEST
    layout(std140) uniform ALPHA_TEST_DATA {
      float alphaThreshold;
    };
  #endif
  layout(std140) uniform Constants {
    float width;
    float strength;
    float offset;
    float time;
  };
  layout(std140) uniform CCGlobal {
    highp   vec4 cc_time;
    mediump vec4 cc_screenSize;
    mediump vec4 cc_nativeSize;
    mediump vec4 cc_debug_view_mode;
    mediump vec4 cc_debug_view_composite_pack_1;
    mediump vec4 cc_debug_view_composite_pack_2;
    mediump vec4 cc_debug_view_composite_pack_3;
  };
  layout(std140) uniform CCCamera {
    highp   mat4 cc_matView;
    highp   mat4 cc_matViewInv;
    highp   mat4 cc_matProj;
    highp   mat4 cc_matProjInv;
    highp   mat4 cc_matViewProj;
    highp   mat4 cc_matViewProjInv;
    highp   vec4 cc_cameraPos;
    mediump vec4 cc_surfaceTransform;
    mediump vec4 cc_screenScale;
    mediump vec4 cc_exposure;
    mediump vec4 cc_mainLitDir;
    mediump vec4 cc_mainLitColor;
    mediump vec4 cc_ambientSky;
    mediump vec4 cc_ambientGround;
    mediump vec4 cc_fogColor;
    mediump vec4 cc_fogBase;
    mediump vec4 cc_fogAdd;
    mediump vec4 cc_nearFar;
    mediump vec4 cc_viewPort;
  };
  in vec2 mapPos;
  #if USE_TEXTURE
    in vec2 uv0;
    uniform sampler2D cc_spriteTexture;
  #endif
  vec4 frag () {
    vec4 src_color = vec4(1, 1, 1, 1);
    vec2 c = mapPos;
    c.y =  1. - c.y;
#if USE_TEXTURE
    src_color = CCSampleWithAlphaSeparated(cc_spriteTexture, uv0);
    float gray  = 0.2126 * src_color.r + 0.7152 * src_color.g + 0.0722 * src_color.b;
    #if IS_GRAY
      src_color.r = src_color.g = src_color.b = gray;
    #endif
#endif
    float start = tan(time/1.414);
    float x = abs(start - offset * c.y - c.x) / width;
    float s = strength * smoothstep(1., 0., x) * gray * gray;
    src_color.rgb *= (1. + s);
    return src_color;
  }
layout(location = 0) out vec4 cc_FragColor;
void main() { cc_FragColor = frag(); }

